import React from 'react';
import './Welcome.css';

function Welcome() {
  return (
    <div className="welcome">
      <h1>Welcome to Top Software</h1>
      <p>We build innovative apps and websites to bring your vision to life.</p>
    </div>
  );
}

export default Welcome;
